import React , {Component} from 'react'
import ReactDOM from 'react-dom';
import { Container, Row, Col } from 'reactstrap';


class CalculatorButton extends Component{

  render(){

    return(
      <Row className="justify-content-md-center">
          <div className="col-md-3" ><button value="7" onClick={ e => calculate(e.this.value)}>7</button></div>
          <div className="col-md-3" ><button value="8" onClick={ e => calculate(e.this.value)}>8</button></div>
          <div className="col-md-3" ><button value="9" onClick={ e => calculate(e.this.value)}>9</button></div>
          <div className="col-md-3" ><button value="+" onClick={ e => calculate(e.this.value)}>+</button></div>

          <div className="col-md-3" ><button value="4" onClick={ e => calculate(e.this.value)}>4</button></div>
          <div className="col-md-3" ><button value="5" onClick={ e => calculate(e.this.value)}>5</button></div>
          <div className="col-md-3" ><button value="6" onClick={ e => calculate(e.this.value)}>6</button></div>
          <div className="col-md-3" ><button value="-" onClick={ e => calculate(e.this.value)}>-</button></div>

          <div className="col-md-3" ><button value="1" onClick={ e => calculate(e.this.value)}>1</button></div>
          <div className="col-md-3" ><button value="2" onClick={ e => calculate(e.this.value)}>2</button></div>
          <div className="col-md-3" ><button value="3" onClick={ e => calculate(e.this.value)}>3</button></div>
          <div className="col-md-3" ><button value="*" onClick={ e => calculate(e.this.value)}>*</button></div>

          <div className="col-md-3" ><button value="0" onClick={ e => calculate(e.this.value)}>0</button></div>
          <div className="col-md-3" ><button value="CLR" onClick={ e => calculate(e.this.value)}>CLR</button></div>
          <div className="col-md-3" ><button value="=" onClick={ e => calculate(e.this.value)}>=</button></div>
          <div className="col-md-3" ><button value="/" onClick={ e => calculate(e.this.value)}>/</button></div>

      </Row>

    )

  }


}



export default CalculatorButton ;
